import {createSlice} from "@reduxjs/toolkit";


const initialState = {
    item:[],
    status:null
}
const productSlice = {
    name:'products',
    initialState,
    reducers:{
        test:()=>{
            console.log('good')
        }
    }
}

export default productSlice.reducers
